INSERT INTO `s_notice2` (`id`, `title`, `is_top`, `content`, `created_at`, `updated_at`, `file`, `s_title`) VALUES
(5, '消失模矾土', 0, '<p><a href="http://www.yqfantu.com/cpyl/" style="margin: 0px; padding: 0px; text-decoration-line: none; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><mark style="margin: 0px; padding: 0px;"><strong style="margin: 0px; padding: 0px;">消失模铸造涂料耐火基料整体解决方案---矾土及莫来石砂粉</strong></mark></a><span style="font-family: 微软雅黑, sans-serif, arial; font-size: 12px;"></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">产品简述：</strong><br style="margin: 0px; padding: 0px;"/>目前国内消失模铸造工艺一般采用浸涂法在模具表面涂上耐火涂料进行干燥后，进而填上铸造砂并负压震实，最后进行熔化浇注和落砂的清理。<br style="margin: 0px; padding: 0px;"/>为了使耐火涂层厚度均匀一般通过调整涂料的浓度和浸涂次数来控制。目前市场上传统的耐火基料一般是200目的矾土粉配石英砂。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><img alt="消失模矾土1" src="http://www.yqfantu.com/uploadfile/2018/0131/20180131090422875.jpg" style="margin: 2px 0px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;">矾土粉通常作为第一涂层，由于矾土原料市场质量标准控制混乱及200目矾土粉规格单一，易造成铸件的龟裂、气孔、皱皮等透气性差造成的问题和缺陷。<br style="margin: 0px; padding: 0px;"/>为了控制成本消失模第二、三涂层通常由石英砂或使用矾土和石英砂按照一定比例混合制成，由于石英砂是未经煅烧原料，相对于其他铝硅系耐火原料遇高温膨胀率大，热振稳定性差，导致在铸件在铸造过程中出现变形、精度低、粘砂等问题的概率增高。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;">我厂推出的矾土和莫来石砂粉相比传统的耐火基料价格优势更加明显，面层使用矾土，第二三层使用莫来石砂作为耐火基料，降低生产成本的同时，提高铸件的生产效率，减少龟裂、气孔、皱皮、变形、粘砂等质量问题的出现。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><img alt="消失模矾土2" src="http://www.yqfantu.com/uploadfile/2018/0131/20180131090442763.jpg" style="margin: 2px 0px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">1.耐火温度高、热稳定性强，不龟裂</strong><br style="margin: 0px; padding: 0px;"/>矾土莫来石砂属于铝硅系产品，经过煅烧后耐火度和热振稳定性远远优于由单晶硅组成晶相结构的石英砂，且不易被液态金属润湿形成低熔物，可以克服石英砂热膨胀系数大，冷凝时退让性差的问题导致铸件精度低、粘砂等缺点。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">2.不同的颗粒级配，更好的透气性</strong><br style="margin: 0px; padding: 0px;"/>我厂生产的铸造砂是由雷蒙磨磨制，生产时按照一定的颗粒级配调制混合而成，改善涂料透气性。并且相比球磨机加工的产品，雷蒙磨加工的铸造砂颗粒更好控制，配比更加科学。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">3.涂层之间融合度高，强度高，易脱模</strong><br style="margin: 0px; padding: 0px;"/>不同耐火涂层间都使用铝硅系熟料产品，按照不同的颗粒级配由内而外由细到粗的结合，使得涂层之间融合度更高；增加涂层强度耐冲刷性防止塌箱等问题的同时，也更容易脱模。且矾土莫来砂属中性材料，酸、碱粘结合剂均可使用。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">4.价廉易得，节省成本</strong><br style="margin: 0px; padding: 0px;"/>山西阳泉是有名的耐火材料—铝矾土的产地。铝矾土铝含量高，抗折强度高，线变化率小，钾钠钙等元素含量低，料质纯净更适宜做耐火基料，矿石山脉储量大，价格相对低廉易得。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">颗粒形态：</strong><br style="margin: 0px; padding: 0px;"/>粉状</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">包装运输：</strong><br style="margin: 0px; padding: 0px;"/>铲车散装，我厂与本地火车皮货运部、各大物流园和货运代理都建立了多年良好的合作关系，最大限度为客户降低运输成本。</p><p><br/></p>', '1529316020', '1529316020', '2018-06-18-18:00:20-5b2782b4c08ad.jpg', '目前国内消失模铸造工艺一般采用浸涂法在模具表面涂上耐火涂料进行干燥后，进而填上铸造砂并负压震实，最后进行熔化浇注和落砂的清理。 为了使耐火涂层厚度均匀一般通过调整涂料的浓度和浸涂次数来控制。目前市场上传统的耐火基料一般是200目的矾土粉配石英砂。'),
(6, '白色45铝矾土', 0, '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px;"><strong style="margin: 0px; padding: 0px;">产品简述：</strong><br style="margin: 0px; padding: 0px;"/>铝矾土是耐火温度不低于1580摄氏度的无机非金属材料，是服务高温技术的基础材料，是砌筑窑炉等热工设备的结构材料，也是制造某些高温容器和部件或起特殊作用的功能性材料。高品位的铝矾土具有良好的组织结构，热学性能、力学性能和使用性能。既有较高的耐火度、荷重软化温度、体积稳定性、抗热震稳定性和抗化学侵蚀等性能，能承受各种物理化学变化和机械作用，满足热工设备及部件的使用要求。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px;"><img alt="白色四级矾土熟料1" src="http://www.yqfantu.com/uploadfile/2017/0323/20170323062637877.jpg" style="margin: 2px 0px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/><br style="margin: 0px; padding: 0px;"/><img alt="白色四级矾土熟料2" src="http://www.yqfantu.com/uploadfile/2017/0323/20170323062649469.jpg" style="margin: 0px 0px 2px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px;"><strong style="margin: 0px; padding: 0px;">颗粒形态：</strong><br style="margin: 0px; padding: 0px;"/>煅烧大块儿状</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px;"><strong style="margin: 0px; padding: 0px;">理化指标：</strong><br style="margin: 0px; padding: 0px;"/>Al2O3≥46%、Fe2O3≤1.35%、体密≥2.25g/cm3、耐火度≥1350℃</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px;"><strong style="margin: 0px; padding: 0px;">包装运输：</strong><br style="margin: 0px; padding: 0px;"/>铲车散装，我厂与本地火车皮货运部、各大物流园和货运代理都建立了多年良好的合作关系，最大限度为客户降低运输成本。</p><p><br/></p>', '1529316166', '1529316166', '2018-06-18-18:02:46-5b27834657d15.jpg', '铝矾土是耐火温度不低于1580摄氏度的无机非金属材料，是服务高温技术的基础材料，是砌筑窑炉等热工设备的结构材料，也是制造某些高温容器和部件或起特殊作用的功能性材料。高品位的铝矾土具有良好的组织结构，热学性能、力学性能和使用性能。既有较高的耐火度、荷重软'),
(7, '白色45铝矾土砂', 0, '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">产品简述：</strong><br style="margin: 0px; padding: 0px;"/>铝矾土骨料一般是指粒径大于0.09mm的颗粒料。它是不定型耐火材料组织结构中的主体材料，起骨架作用，决定其物理力学性能和高温使用性能，也是决定材料属性及其应用范围的重要依据。矾土骨料也是定型耐火材料的原料。生产实践证明，良好的颗粒及其级配。能获得致密性高性能好的材料。一般来说，矾土骨料的品种和临界粒径，应根据炉衬厚度、施工方法和使用条件的要求来选择。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><img alt="白色四级矾土骨料" src="http://www.yqfantu.com/uploadfile/2017/0325/20170325050751573.jpg" style="margin: 2px 0px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">颗粒形态：</strong><br style="margin: 0px; padding: 0px;"/>可选用对辊机（三角状）或马克（圆粒状）加工；常备规格为0-1mm，1-3mm ，3-5mm，5-8mm，8-15mm等</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">理化指标：</strong><br style="margin: 0px; padding: 0px;"/>Al2O3≥46%、Fe2O3≤1.35%、体密≥2.25g/cm3、耐火度 ≥1350℃</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">包装运输：</strong><br style="margin: 0px; padding: 0px;"/>可选50kg袋或吨袋包装，也可按客户要求进行调整生产。我厂与本地火车皮 货运部、各大物流园和货运代理都建立了多年良好的合作关系，最大限度为 客户降低运输成本。</p><p><br/></p>', '1529316224', '1529316224', '2018-06-18-18:03:44-5b278380b243a.jpg', '铝矾土骨料一般是指粒径大于0.09mm的颗粒料。它是不定型耐火材料组织结构中的主体材料，起骨架作用，决定其物理力学性能和高温使用性能，也是决定材料属性及其应用范围的重要依据。矾土骨料也是定型耐火材料的原料。生产实践证明，良好的颗粒及其级配。能获得致密性高'),
(8, '白色45铝矾土粉', 0, '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">产品简述：</strong><br style="margin: 0px; padding: 0px;"/>影响高铝矾土烧结的两个主要因素是二次莫来石化和液相作用。前者取决于Al2O3/SiO2比值，起阻碍烧结的作用；后者起促进烧结作用。此外，Fe2O3和TiO2进入刚玉和莫来石晶格的固相反应，也起辅助促进烧结的作用。在1200～1400℃，二次莫来石化引起膨胀，阻碍烧结作用是主要的；在1400℃以上，二次莫来石化反应基本完成，液相促进晶粒的溶解一沉淀过程，导致致密化，这时，促进烧结作用是主要的。Ⅱ级高铝矾土Al2O3/SiO2比值接近2．55，正好是莫来石组成区，生成二次莫来石量最多，最难烧结。各级高铝矾土的烧结温度如下：特级为1600～1700℃，I级为1500～1600℃，Ⅱ级为1600～1700℃，Ⅲ级为1500～1550℃。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><img alt="白色四级矾土细粉" src="http://www.yqfantu.com/uploadfile/2017/0325/20170325065030710.jpg" style="margin: 2px 0px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">颗粒形态：</strong><br style="margin: 0px; padding: 0px;"/>矾土细粉我厂使用雷蒙磨加工，常备规格为100-325目。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">理化指标：</strong><br style="margin: 0px; padding: 0px;"/>Al2O3≥46%、Fe2O3≤1.35%、体密≥2.25g/cm3、耐火度≥1350℃</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">包装运输：</strong><br style="margin: 0px; padding: 0px;"/>可选50kg袋或吨袋包装，也可按客户要求进行调整生产。我厂与本地火车皮 货运部、各大物流园和货运代理都建立了多年良好的合作关系，最大限度为 客户降低运输成本。</p><p><br/></p>', '1529316279', '1529316279', '2018-06-18-18:04:39-5b2783b79a698.jpg', '影响高铝矾土烧结的两个主要因素是二次莫来石化和液相作用。前者取决于Al2O3/SiO2比值，起阻碍烧结的作用；后者起促进烧结作用。此外，Fe2O3和TiO2进入刚玉和莫来石晶格的固相反应，也起辅助促进烧结的作用。在1200～1400℃，二次莫来石化引起膨胀，阻碍烧结作用是主要的；在1400℃以上，二次莫来石化反应基本完成，液相促进晶粒的溶解一沉淀过程，导致致密化，这时，促进烧结作用是主要的。'),
(9, '煅烧88铝矾土', 0, '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">产品简述：</strong><br style="margin: 0px; padding: 0px;"/>铝矾土熟料是由铝矾土矿石经高温窑炉（不同形式）高温煅烧脱结晶水后而成。熟料按用途又分研磨级，耐火级，电焊级等。按照其AL203含量不同分为特级铝矾土，一级铝矾土，二级铝矾土，三级铝矾土，四级铝矾土等。铝矾土熟料是制造各种耐火材料的主要原料：如定型耐火制品（各种耐火砖，预制件），不定型耐火材料（各种浇注料，捣打料，耐火泥浆等）。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><img alt="88倒烟窑矾土熟料1" src="http://www.yqfantu.com/uploadfile/2017/0323/20170323062159473.jpg" style="margin: 2px 0px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/><br style="margin: 0px; padding: 0px;"/><img alt="88倒烟窑矾土熟料2" src="http://www.yqfantu.com/uploadfile/2017/0323/20170323062213373.jpg" style="margin: 0px 0px 2px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/><br style="margin: 0px; padding: 0px;"/><img alt="88倒烟窑矾土熟料3" src="http://www.yqfantu.com/uploadfile/2017/0323/20170323062224888.jpg" style="margin: 0px 0px 2px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">颗粒形态：</strong><br style="margin: 0px; padding: 0px;"/>煅烧大块儿状</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">理化指标：</strong><br style="margin: 0px; padding: 0px;"/>Al2O3≥88%、Fe2O3≤1.75%、体密≥3.25g/cm3、耐火度≥1790℃</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">包装运输：</strong><br style="margin: 0px; padding: 0px;"/>铲车散装，我厂与本地火车皮货运部、各大物流园和货运代理都建立了多年良好的合作关系，最大限度为客户降低运输成本。</p><p><br/></p>', '1529316347', '1529316347', '2018-06-18-18:05:47-5b2783fb4b23b.jpg', '铝矾土熟料是由铝矾土矿石经高温窑炉（不同形式）高温煅烧脱结晶水后而成。熟料按用途又分研磨级，耐火级，电焊级等。按照其AL203含量不同分为特级铝矾土，一级铝矾土，二级铝矾土，三级铝矾土，四级铝矾土等。铝矾土熟料是制造各种耐火材料的主要原料：如定型耐火制品（各种耐火砖，预制件），不定型耐火材料（各种浇注料，捣打料，耐火泥浆等）。'),
(10, '煅烧88铝矾土砂', 0, '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;">铝矾土骨料是耐火浇注料的重要组成之一。其品级、最大粒径及颗粒级配等，是影响性能的主要因素。另外矾土的杂质含量和烧结优劣等也影响其性能。例如，当矾土熟料作为耐火骨料时，随着三氧化二铝含量增加即品级提高，浇注料的耐火度和荷重软化温度提高。烧后线变化减小，当该料欠烧或杂质含量多时，其耐火度和荷重软化温度降低烧后线收缩大。矾土骨料颗粒形状越不规则越好，尽量不用长片状料，其最大粒径应根据衬体厚度而定。当铝矾土骨料最大粒径确定后，其颗粒级配对耐火浇注料性能有较大影响</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><img alt="煅烧88铝矾土砂1" src="http://www.yqfantu.com/uploadfile/2017/0527/20170527041830178.jpg" style="margin: 2px 0px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/><br style="margin: 0px; padding: 0px;"/><img alt="煅烧88铝矾土砂2" src="http://www.yqfantu.com/uploadfile/2017/0527/20170527041854935.jpg" style="margin: 0px 0px 2px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/><br style="margin: 0px; padding: 0px;"/><img alt="煅烧88铝矾土砂3" src="http://www.yqfantu.com/uploadfile/2017/0527/20170527041840586.jpg" style="margin: 0px 0px 2px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">颗粒形态：</strong><br style="margin: 0px; padding: 0px;"/>可选用对辊机（三角状）或马克（圆粒状）加工；常备规格为0-1mm，1-3mm ，3-5mm，5-8mm，8-15mm等</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">理化指标：</strong><br style="margin: 0px; padding: 0px;"/>Al2O3≥88%、Fe2O3≤1.75%、体密≥3.25g/cm3、耐火度 ≥1790℃</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">包装运输：</strong><br style="margin: 0px; padding: 0px;"/>可选50kg袋或吨袋包装，也可按客户要求进行调整生产。我厂与本地火车皮 货运部、各大物流园和货运代理都建立了多年良好的合作关系，最大限度为 客户降低运输成本。</p><p><br/></p>', '1529328202', '1529328202', '2018-06-18-21:23:22-5b27b24ae00cd.jpg', '铝矾土骨料是耐火浇注料的重要组成之一。其品级、最大粒径及颗粒级配等，是影响性能的主要因素。另外矾土的杂质含量和烧结优劣等也影响其性能。例如，当矾土熟料作为耐火骨料时，随着三氧化二铝含量增加即品级提高，浇注料的耐火度和荷重软化温度提高。烧后线变化减小，当该料欠烧或杂质含量多时，其耐火度和荷重软化温度降低烧后线收缩大。矾土骨料颗粒形状越不规则越好，尽量不用长片状料，其最大粒径应根据衬体厚度而定。当铝矾土骨料最大粒径确定后，其颗粒级配对耐火浇注料性能有较大影响'),
(11, '煅烧88铝矾土粉', 0, '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">产品简述：</strong><br style="margin: 0px; padding: 0px;"/>铝矾土粉是经过煅烧的铝钒土，在燃烧过程中需经过分解脱水、二次莫来石化及重晶烧经三个阶段，后经雷蒙磨粉碎加工振荡成粉，分筛成不同规格。粒度通常为100目-325目，在耐火材料行业得到了广泛的应用。铝矾土砂（粉）属新型硅铝系高级耐火材料，适用于熔模铸造用面层涂料及撒砂料，同时也可作为其它各种铸造涂料的耐火骨料，本品膨胀系数小、耐火度高、化学稳定性好，消失模铸钢、铸铁涂料常用耐火材料.</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><img alt="88倒烟窑矾土细粉" src="http://www.yqfantu.com/uploadfile/2017/0325/20170325064548487.jpg" style="margin: 2px 0px; padding: 0px; border: medium none; vertical-align: middle; max-width: 550px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">颗粒形态：</strong><br style="margin: 0px; padding: 0px;"/>矾土细粉我厂使用雷蒙磨加工，常备规格为100-325目。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">理化指标：</strong><br style="margin: 0px; padding: 0px;"/>Al2O3≥88%、Fe2O3≤1.75%、体密≥3.25g/cm3、耐火度 ≥1790℃</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, sans-serif, arial; font-size: 12px; white-space: normal;"><strong style="margin: 0px; padding: 0px;">包装运输：</strong><br style="margin: 0px; padding: 0px;"/>可选50kg袋或吨袋包装，也可按客户要求进行调整生产。我厂与本地火车皮 货运部、各大物流园和货运代理都建立了多年良好的合作关系，最大限度为 客户降低运输成本。</p><p><br/></p>', '1529328311', '1529328311', '2018-06-18-21:25:11-5b27b2b76e43b.jpg', '铝矾土粉是经过煅烧的铝钒土，在燃烧过程中需经过分解脱水、二次莫来石化及重晶烧经三个阶段，后经雷蒙磨粉碎加工振荡成粉，分筛成不同规格。粒度通常为100目-325目，在耐火材料行业得到了广泛的应用。铝矾土砂（粉）属新型硅铝系高级耐火材料，适用于熔模铸造用面层涂料及撒砂料，同时也可作为其它各种铸造涂料的耐火骨料，本品膨胀系数小、耐火度高、化学稳定性好，消失模铸钢、铸铁涂料常用耐火材料.');
